    component: Container
  }, {
    path: '/Tabbar',
    component: Tabbar
  }, {
    path: '/Fa',
    component: Fa
  }, {
    path: '/Home',
    component: Home
  }, {
    path: '/messagelist',
    component: MessageList
  }]
});
